import "../css/Game_Detail_Footer.css";

export default function Game_Detail_Footer() {
  return (
    <>
      <div className="Footer">
        <button className="addbtn">추가하기</button>
        <button className="backbtn">뒤로가기</button>
      </div>
    </>
  );
}
